import "./instrument.css"
function Instrument(props){
    const music =()=>{
        const mus=new Audio("../assets/sounds/"+props.music);

    }
    return(
        <div>
            <button className={props.class} onClick={music}>{props.text}</button>
        </div>
    )
}
export default Instrument;
